import React, { useState } from "react";
import "./App.css";

function MyButton() {
  const [buttonText, setButtonText] = useState("CLICK ME");
  const clickedText = "CLICKED";

  const handleClick = () => {
    setButtonText(clickedText);
  };  

  return (
    <button onClick={handleClick}>
      {buttonText}
    </button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TitanEats</h1>
        <MyButton />
      </header>
    </div>
  );
} 
export default App;
